		<div>
			<p style="margin-top:35.65pt; margin-left:204.6pt; margin-bottom:0pt; text-indent:-41.55pt; line-height:88%; font-size:54pt">
				<span style="letter-spacing:-0.3pt">Introduction</span><span style="letter-spacing:-2.8pt"> </span><span style="letter-spacing:-0.3pt">to</span><span style="letter-spacing:-2.75pt"> </span><span style="letter-spacing:-0.3pt">Database </span>Management<span style="letter-spacing:-1.2pt"> </span>System
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h1 style="margin-top:0pt; margin-left:26.2pt; margin-bottom:0pt; line-height:48.9pt">
				<span style="font-size:44pt; font-weight:normal">What</span><span style="font-size:44pt; font-weight:normal; letter-spacing:-1.5pt"> </span><span style="font-size:44pt; font-weight:normal">is</span><span style="font-size:44pt; font-weight:normal; letter-spacing:-1.5pt"> </span><span style="font-size:44pt; font-weight:normal; letter-spacing:-0.1pt">Data?</span>
			</h1>
			<p style="margin-top:34.15pt; margin-left:44.15pt; margin-bottom:0pt; text-indent:-17.95pt; font-size:26pt">
				<span style="font-family:Arial">•</span><span style="width:8.85pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>From<span style="letter-spacing:-0.25pt"> </span>Dictionary<span style="letter-spacing:-0.2pt"> </span><span style="letter-spacing:-0.5pt">:</span>
			</p>
			<p style="margin-top:7.75pt; margin-left:26.2pt; margin-bottom:0pt; text-indent:52.9pt; line-height:69%; font-size:26pt">
				Factual<span style="letter-spacing:-0.5pt"> </span>information<span style="letter-spacing:-0.45pt"> </span>(such<span style="letter-spacing:-0.65pt"> </span>as<span style="letter-spacing:-0.4pt"> </span>measurements<span style="letter-spacing:-0.85pt"> </span>or<span style="letter-spacing:-0.4pt"> </span>statistics)<span style="letter-spacing:-0.75pt"> </span>used<span style="letter-spacing:-0.75pt"> </span>as<span style="letter-spacing:-0.4pt"> </span>a<span style="letter-spacing:-0.45pt"> </span>basis for reasoning, discussion, or calculation
			</p>
			<p style="margin-top:2.2pt; margin-left:44.15pt; margin-bottom:0pt; text-indent:-17.95pt; font-size:26pt">
				<span style="font-family:Arial">•</span><span style="width:8.85pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>From<span style="letter-spacing:-0.3pt"> </span>Wikipedia<span style="letter-spacing:-0.3pt"> </span><span style="letter-spacing:-0.5pt">:</span>
			</p>
			<p style="margin-top:7.85pt; margin-left:26.2pt; margin-bottom:0pt; text-indent:72pt; line-height:69%; font-size:26pt">
				<strong>Data</strong><strong><span style="letter-spacing:-0.45pt"> </span></strong>are<span style="letter-spacing:-0.55pt"> </span>characteristics<span style="letter-spacing:-0.8pt"> </span>,<span style="letter-spacing:-0.4pt"> </span>usually<span style="letter-spacing:-0.55pt"> </span>numerical,<span style="letter-spacing:-0.65pt"> </span>that<span style="letter-spacing:-0.4pt"> </span>are<span style="letter-spacing:-0.55pt"> </span>collected<span style="letter-spacing:-0.65pt"> </span>through observation. In a more technical sense, data is a set of values
			</p>
			<p style="margin-top:0pt; margin-left:26.2pt; margin-bottom:0pt; line-height:69%; font-size:26pt">
				of<span style="letter-spacing:-0.35pt"> </span>qualitative<span style="letter-spacing:-0.45pt"> </span>or<span style="letter-spacing:-0.3pt"> </span>quantitative<span style="letter-spacing:-0.35pt"> </span>variables<span style="letter-spacing:-0.4pt"> </span>about<span style="letter-spacing:-0.3pt"> </span>one<span style="letter-spacing:-0.45pt"> </span>or<span style="letter-spacing:-0.3pt"> </span>more<span style="letter-spacing:-0.45pt"> </span>persons<span style="letter-spacing:-0.55pt"> </span>or<span style="letter-spacing:-0.3pt"> </span>objects, while a <strong>datum </strong>(singular of data) is a single value of a single variable.
			</p>
			<p style="margin:9.75pt 28.9pt 0pt 44.2pt; text-indent:-18.05pt; line-height:69%; font-size:26pt">
				<span style="font-family:Arial">•</span><span style="width:8.85pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>Example:<span style="letter-spacing:-0.55pt"> </span>Name,<span style="letter-spacing:-0.6pt"> </span>Address,<span style="letter-spacing:-0.7pt"> </span>Zip,<span style="letter-spacing:-0.45pt"> </span>SSN<span style="letter-spacing:-0.5pt"> </span>are<span style="letter-spacing:-0.4pt"> </span>characteristics<span style="letter-spacing:-0.75pt"> </span>or<span style="letter-spacing:-0.35pt"> </span>information<span style="letter-spacing:-0.4pt"> </span>about a person.
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h1 style="margin-top:0pt; margin-left:26.2pt; margin-bottom:0pt; line-height:48.9pt">
				<span style="font-size:44pt; font-weight:normal; letter-spacing:-0.1pt">Types</span><span style="font-size:44pt; font-weight:normal; letter-spacing:-2.2pt"> </span><span style="font-size:44pt; font-weight:normal; letter-spacing:-0.1pt">of</span><span style="font-size:44pt; font-weight:normal; letter-spacing:-2.15pt"> </span><span style="font-size:44pt; font-weight:normal; letter-spacing:-0.2pt">Data</span>
			</h1>
			<p style="margin-top:38.6pt; margin-left:44.2pt; margin-bottom:0pt; text-indent:-18pt; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:8.2pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><span style="letter-spacing:-0.3pt">Unstructured-</span><span style="letter-spacing:-0.2pt">Data</span>
			</p>
			<p style="margin:9.1pt 92.95pt 0pt 44.2pt; text-indent:-18.05pt; line-height:89%; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:8.15pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>Structured<span style="letter-spacing:-0.6pt"> </span>–<span style="letter-spacing:-0.75pt"> </span>Information<span style="letter-spacing:-0.8pt"> </span>(interpreted<span style="letter-spacing:-0.85pt"> </span>data<span style="letter-spacing:-0.65pt"> </span>–<span style="letter-spacing:-0.75pt"> </span>data<span style="letter-spacing:-0.9pt"> </span>supplied<span style="letter-spacing:-0.5pt"> </span>with <span style="letter-spacing:-0.1pt">semantics)</span>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h1 style="margin-top:0pt; margin-left:26.2pt; margin-bottom:0pt; line-height:48.9pt">
				<span style="font-size:44pt; font-weight:normal; letter-spacing:-0.1pt">Structured</span><span style="font-size:44pt; font-weight:normal; letter-spacing:-1.6pt"> </span><span style="font-size:44pt; font-weight:normal; letter-spacing:-0.1pt">and</span><span style="font-size:44pt; font-weight:normal; letter-spacing:-1.95pt"> </span><span style="font-size:44pt; font-weight:normal; letter-spacing:-0.1pt">Unstructured</span><span style="font-size:44pt; font-weight:normal; letter-spacing:-1.85pt"> </span><span style="font-size:44pt; font-weight:normal; letter-spacing:-0.2pt">Data</span>
			</h1>
			<p style="margin-top:4.8pt; margin-bottom:0pt; font-size:10pt">
				<img src="data:image/jpeg;base64," width="998" height="472" alt="" ><br >
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<p style="margin-top:0pt; margin-left:26.2pt; margin-bottom:0pt; line-height:48.9pt">
				<span style="font-size:44pt">How</span><span style="font-size:44pt; letter-spacing:-1.8pt"> </span><span style="font-size:44pt">do</span><span style="font-size:44pt; letter-spacing:-1.95pt"> </span><span style="font-size:44pt">we</span><span style="font-size:44pt; letter-spacing:-1.85pt"> </span><span style="font-size:44pt">store</span><span style="font-size:44pt; letter-spacing:-1.9pt"> </span><span style="font-size:44pt">Data</span><span style="font-size:44pt; letter-spacing:-1.9pt"> </span><span style="font-size:44pt">into</span><span style="font-size:44pt; letter-spacing:-1.95pt"> </span><span style="font-size:44pt; letter-spacing:-0.1pt">Computers?.</span>
			</p>
			<p style="margin:41.8pt 96.65pt 0pt 44.2pt; text-indent:-18.05pt; line-height:88%; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:8.25pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>Data<span style="letter-spacing:-0.75pt"> </span>could<span style="letter-spacing:-0.55pt"> </span>be<span style="letter-spacing:-0.7pt"> </span>stored<span style="letter-spacing:-0.7pt"> </span>computers<span style="letter-spacing:-0.45pt"> </span>in<span style="letter-spacing:-0.75pt"> </span>File<span style="letter-spacing:-0.75pt"> </span>System<span style="letter-spacing:-0.55pt"> </span>and<span style="letter-spacing:-0.7pt"> </span>or<span style="letter-spacing:-0.8pt"> </span>Database Management and or content management systems.
			</p>
			<p style="margin:10.45pt 35.95pt 0pt 44.2pt; text-indent:-18.05pt; line-height:88%; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:8.25pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>Let<span style="letter-spacing:-0.5pt"> </span>us<span style="letter-spacing:-0.4pt"> </span>focus<span style="letter-spacing:-0.25pt"> </span>on<span style="letter-spacing:4pt"> </span>File<span style="letter-spacing:-0.45pt"> </span>System<span style="letter-spacing:-0.3pt"> </span>and<span style="letter-spacing:-0.4pt"> </span>Database<span style="letter-spacing:-0.35pt"> </span>approaches<span style="letter-spacing:-0.35pt"> </span>.<span style="letter-spacing:-0.5pt"> </span>Each<span style="letter-spacing:-0.4pt"> </span>one<span style="letter-spacing:-0.45pt"> </span>has its own advantages and disadvantages.
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h1 style="margin-top:0pt; margin-left:26.3pt; margin-bottom:0pt; line-height:48.9pt">
				<span style="font-size:44pt; font-weight:normal; letter-spacing:-0.3pt">File</span><span style="font-size:44pt; font-weight:normal; letter-spacing:-1.8pt"> </span><span style="font-size:44pt; font-weight:normal; letter-spacing:-0.3pt">System</span><span style="font-size:44pt; font-weight:normal; letter-spacing:-2.05pt"> </span><span style="font-size:44pt; font-weight:normal; letter-spacing:-0.3pt">Vs</span><span style="font-size:44pt; font-weight:normal; letter-spacing:-1.8pt"> </span><span style="font-size:44pt; font-weight:normal; letter-spacing:-0.3pt">Database</span><span style="font-size:44pt; font-weight:normal; letter-spacing:-1.95pt"> </span><span style="font-size:44pt; font-weight:normal; letter-spacing:-0.3pt">System</span>
			</h1>
			<p style="margin-top:36.3pt; margin-left:27.75pt; margin-bottom:0pt; font-size:24pt">
				<strong><span style="vertical-align:6pt">File</span></strong><strong><span style="letter-spacing:-0.4pt; vertical-align:6pt"> </span></strong><strong><span style="letter-spacing:-0.1pt; vertical-align:6pt">System</span></strong><strong><span style="width:282.96pt; vertical-align:6pt; display:inline-block">&#xa0;</span></strong><strong>Database</strong><strong><span style="letter-spacing:-0.75pt"> </span></strong><strong><span style="letter-spacing:-0.1pt">System</span></strong>
			</p>
			<p style="margin-top:0.55pt; margin-bottom:0pt; font-size:2pt">
				<img src="data:image/jpeg;base64," width="895" height="424" alt="" ><br >
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h1 style="margin-top:0pt; margin-left:26.3pt; margin-bottom:0pt; line-height:48.9pt">
				<span style="font-size:44pt; font-weight:normal; letter-spacing:-0.3pt">File</span><span style="font-size:44pt; font-weight:normal; letter-spacing:-1.9pt"> </span><span style="font-size:44pt; font-weight:normal; letter-spacing:-0.3pt">System</span><span style="font-size:44pt; font-weight:normal; letter-spacing:-2.2pt"> </span><span style="font-size:44pt; font-weight:normal; letter-spacing:-0.3pt">Vs</span><span style="font-size:44pt; font-weight:normal; letter-spacing:-1.85pt"> </span><span style="font-size:44pt; font-weight:normal; letter-spacing:-0.3pt">Database</span><span style="font-size:44pt; font-weight:normal; letter-spacing:-2.05pt"> </span><span style="font-size:44pt; font-weight:normal; letter-spacing:-0.3pt">System</span><span style="font-size:44pt; font-weight:normal; letter-spacing:-2pt"> </span><span style="font-size:44pt; font-weight:normal; letter-spacing:-0.3pt">Cont…</span>
			</h1>
			<p style="margin-top:5.85pt; margin-bottom:0pt; font-size:44pt">
				&#xa0;
			</p>
			<p style="margin-top:0pt; margin-left:26.3pt; margin-bottom:0pt; font-size:24pt">
				<strong>File</strong><strong><span style="letter-spacing:-0.4pt"> </span></strong><strong><span style="letter-spacing:-0.1pt">System</span></strong><strong><span style="width:286.56pt; display:inline-block">&#xa0;</span></strong><strong>Database</strong><strong><span style="letter-spacing:-0.75pt"> </span></strong><strong><span style="letter-spacing:-0.1pt">System</span></strong>
			</p>
			<p style="margin-top:4.5pt; margin-bottom:0pt; font-size:10pt">
				<img src="data:image/jpeg;base64," width="812" height="399" alt="" ><br >
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h1 style="margin-top:0pt; margin-left:26.2pt; margin-bottom:0pt; line-height:48.9pt">
				<span style="font-size:44pt; font-weight:normal; letter-spacing:-0.1pt">File</span><span style="font-size:44pt; font-weight:normal; letter-spacing:-2.2pt"> </span><span style="font-size:44pt; font-weight:normal; letter-spacing:-0.1pt">System</span><span style="font-size:44pt; font-weight:normal; letter-spacing:-2.4pt"> </span><span style="font-size:44pt; font-weight:normal; letter-spacing:-0.1pt">Issues</span>
			</h1>
			<p style="margin:42.05pt 23.9pt 0pt 44.2pt; text-indent:-18.05pt; line-height:88%; font-size:18pt">
				<span style="font-family:Arial">•</span><span style="width:11.75pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><strong>Redundancy of</strong><strong><span style="letter-spacing:-0.1pt"> </span></strong><strong>data: </strong>Data is said to be redundant if same data is copied at many places. If a student wants to<span style="letter-spacing:-0.45pt"> </span>change<span style="letter-spacing:-0.3pt"> </span>Phone<span style="letter-spacing:-0.25pt"> </span>number,<span style="letter-spacing:-0.35pt"> </span>he<span style="letter-spacing:-0.25pt"> </span>has<span style="letter-spacing:-0.45pt"> </span>to<span style="letter-spacing:-0.3pt"> </span>get<span style="letter-spacing:-0.45pt"> </span>it<span style="letter-spacing:-0.45pt"> </span>updated<span style="letter-spacing:-0.25pt"> </span>at<span style="letter-spacing:-0.45pt"> </span>various<span style="letter-spacing:-0.35pt"> </span>sections.<span style="letter-spacing:-0.45pt"> </span>Similarly,<span style="letter-spacing:-0.25pt"> </span>old<span style="letter-spacing:-0.3pt"> </span>records<span style="letter-spacing:-0.35pt"> </span>must<span style="letter-spacing:-0.45pt"> </span>be<span style="letter-spacing:-0.25pt"> </span>deleted from all sections representing that student.
			</p>
			<p style="margin:10.2pt 34.65pt 0pt 44.2pt; text-indent:-18.05pt; line-height:89%; font-size:18pt">
				<span style="font-family:Arial">•</span><span style="width:11.75pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><strong>Inconsistency</strong><strong><span style="letter-spacing:-0.1pt"> </span></strong><strong>of Data: </strong>Data is said to be inconsistent if multiple copies of same data does not match with each<span style="letter-spacing:-0.25pt"> </span>other.<span style="letter-spacing:-0.4pt"> </span>If<span style="letter-spacing:-0.4pt"> </span>Phone<span style="letter-spacing:-0.2pt"> </span>number<span style="letter-spacing:-0.3pt"> </span>is<span style="letter-spacing:-0.35pt"> </span>different<span style="letter-spacing:-0.4pt"> </span>in<span style="letter-spacing:-0.25pt"> </span>Accounts<span style="letter-spacing:-0.4pt"> </span>Section<span style="letter-spacing:-0.25pt"> </span>and<span style="letter-spacing:-0.2pt"> </span>Academics<span style="letter-spacing:-0.35pt"> </span>Section,<span style="letter-spacing:-0.15pt"> </span>it<span style="letter-spacing:-0.3pt"> </span>will<span style="letter-spacing:-0.2pt"> </span>be<span style="letter-spacing:-0.3pt"> </span>inconsistent. Inconsistency may be because of typing errors or not updating all copies of same data.
			</p>
			<p style="margin:9.8pt 25.3pt 0pt 44.2pt; text-indent:-18.05pt; line-height:88%; font-size:18pt">
				<span style="font-family:Arial">•</span><span style="width:11.75pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><strong>Difficult Data Access: </strong>A user should know the exact location of file to access data, so the process is very cumbersome<span style="letter-spacing:-0.1pt"> </span>and<span style="letter-spacing:-0.25pt"> </span>tedious.<span style="letter-spacing:-0.15pt"> </span>If<span style="letter-spacing:-0.25pt"> </span>user<span style="letter-spacing:-0.25pt"> </span>wants<span style="letter-spacing:-0.3pt"> </span>to<span style="letter-spacing:-0.3pt"> </span>search<span style="letter-spacing:-0.3pt"> </span>student<span style="letter-spacing:-0.3pt"> </span>hostel<span style="letter-spacing:-0.2pt"> </span>allotment<span style="letter-spacing:-0.2pt"> </span>number<span style="letter-spacing:-0.2pt"> </span>of<span style="letter-spacing:-0.3pt"> </span>a<span style="letter-spacing:-0.25pt"> </span>student<span style="letter-spacing:-0.3pt"> </span>from<span style="letter-spacing:-0.25pt"> </span>10000 unsorted students’ records, how difficult it can be.
			</p>
			<p style="margin:10.3pt 45.55pt 0pt 44.2pt; text-indent:-18.05pt; line-height:88%; font-size:18pt">
				<span style="font-family:Arial">•</span><span style="width:11.75pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><strong>Unauthorized</strong><strong><span style="letter-spacing:-0.4pt"> </span></strong><strong>Access:</strong><strong><span style="letter-spacing:-0.55pt"> </span></strong>File<span style="letter-spacing:-0.15pt"> </span>System<span style="letter-spacing:-0.4pt"> </span>may<span style="letter-spacing:-0.3pt"> </span>lead<span style="letter-spacing:-0.15pt"> </span>to<span style="letter-spacing:-0.35pt"> </span>unauthorized<span style="letter-spacing:-0.05pt"> </span>access<span style="letter-spacing:-0.3pt"> </span>to<span style="letter-spacing:-0.35pt"> </span>data.<span style="letter-spacing:-0.35pt"> </span>If<span style="letter-spacing:-0.4pt"> </span>a<span style="letter-spacing:-0.35pt"> </span>student<span style="letter-spacing:-0.25pt"> </span>gets<span style="letter-spacing:-0.4pt"> </span>access<span style="letter-spacing:-0.3pt"> </span>to<span style="letter-spacing:-0.35pt"> </span>file having his marks, he can change it in unauthorized way.
			</p>
			<p style="margin:10.3pt 20.65pt 0pt 44.2pt; text-indent:-18.05pt; line-height:88%; font-size:18pt">
				<span style="font-family:Arial">•</span><span style="width:11.75pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><strong>No</strong><strong><span style="letter-spacing:-0.25pt"> </span></strong><strong>Concurrent</strong><strong><span style="letter-spacing:-0.5pt"> </span></strong><strong>Access:</strong><strong><span style="letter-spacing:-0.5pt"> </span></strong>The<span style="letter-spacing:-0.15pt"> </span>access<span style="letter-spacing:-0.25pt"> </span>of<span style="letter-spacing:-0.3pt"> </span>same<span style="letter-spacing:-0.3pt"> </span>data<span style="letter-spacing:-0.3pt"> </span>by<span style="letter-spacing:-0.15pt"> </span>multiple<span style="letter-spacing:-0.1pt"> </span>users<span style="letter-spacing:-0.35pt"> </span>at<span style="letter-spacing:-0.3pt"> </span>same<span style="letter-spacing:-0.25pt"> </span>time<span style="letter-spacing:-0.25pt"> </span>is<span style="letter-spacing:-0.3pt"> </span>known<span style="letter-spacing:-0.15pt"> </span>as<span style="letter-spacing:-0.25pt"> </span>concurrency.<span style="letter-spacing:-0.1pt"> </span>File system does not allow concurrency as data can be accessed by only one user at a time.
			</p>
			<p style="margin-top:8.1pt; margin-left:44.2pt; margin-bottom:0pt; text-indent:-18pt; line-height:20.7pt">
