				<span style="font-family:Arial">•</span><span style="width:8.2pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><span style="letter-spacing:-0.1pt">Generally</span><span style="letter-spacing:-1.05pt"> </span><span style="letter-spacing:-0.1pt">Management</span><span style="letter-spacing:-1pt"> </span><span style="letter-spacing:-0.1pt">refers</span><span style="letter-spacing:-1.1pt"> </span><span style="letter-spacing:-0.1pt">create,</span><span style="letter-spacing:-1.2pt"> </span><span style="letter-spacing:-0.1pt">Retrieve,</span><span style="letter-spacing:-1.2pt"> </span><span style="letter-spacing:-0.1pt">update</span><span style="letter-spacing:-0.85pt"> </span><span style="letter-spacing:-0.1pt">and</span><span style="letter-spacing:-1pt"> </span><span style="letter-spacing:-0.1pt">delete.</span>
