			<p style="margin:9.1pt 118.85pt 0pt 44.2pt; text-indent:-18.05pt; line-height:89%; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:8.15pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>For<span style="letter-spacing:-0.55pt"> </span>example:<span style="letter-spacing:-0.4pt"> </span>Money<span style="letter-spacing:-0.55pt"> </span>Management<span style="letter-spacing:-0.45pt"> </span>refers<span style="letter-spacing:-0.6pt"> </span>earning<span style="letter-spacing:-0.5pt"> </span>the<span style="letter-spacing:-0.55pt"> </span>money, querying<span style="letter-spacing:-0.7pt"> </span>money,<span style="letter-spacing:-0.9pt"> </span>distribute<span style="letter-spacing:-0.6pt"> </span>the<span style="letter-spacing:-0.95pt"> </span>money<span style="letter-spacing:-1.05pt"> </span>and<span style="letter-spacing:-0.85pt"> </span>spend<span style="letter-spacing:-0.75pt"> </span>the<span style="letter-spacing:-0.95pt"> </span>money.
