			</h1>
			<p style="margin:41.85pt 49.95pt 0pt 44.2pt; text-indent:-18.05pt; line-height:69%; font-size:26pt">
				<span style="font-family:Arial">•</span><span style="width:8.85pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><strong>Database: </strong>Database is a collection of inter-related data which helps in efficient retrieval, insertion and deletion of data from database and organizes<span style="letter-spacing:-0.55pt"> </span>the<span style="letter-spacing:-0.65pt"> </span>data<span style="letter-spacing:-0.45pt"> </span>in<span style="letter-spacing:-0.5pt"> </span>the<span style="letter-spacing:-0.45pt"> </span>form<span style="letter-spacing:-0.45pt"> </span>of<span style="letter-spacing:-0.45pt"> </span>tables,<span style="letter-spacing:-0.6pt"> </span>views,<span style="letter-spacing:-0.6pt"> </span>schemas,<span style="letter-spacing:-0.65pt"> </span>reports<span style="letter-spacing:-0.55pt"> </span>etc.<span style="letter-spacing:-0.5pt"> </span>For Example,<span style="letter-spacing:-0.5pt"> </span>university<span style="letter-spacing:-0.6pt"> </span>database<span style="letter-spacing:-0.65pt"> </span>organizes<span style="letter-spacing:-0.5pt"> </span>the<span style="letter-spacing:-0.5pt"> </span>data<span style="letter-spacing:-0.35pt"> </span>about<span style="letter-spacing:-0.45pt"> </span>students,<span style="letter-spacing:-0.7pt"> </span>faculty, and admin staff etc. which helps in efficient retrieval, insertion and deletion of data from it.
			</p>
			<p style="margin-top:1.95pt; margin-left:44.15pt; margin-bottom:0pt; text-indent:-17.95pt; line-height:29.95pt">
				<span style="font-family:Arial; font-size:26pt">•</span><span style="width:8.85pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><span style="font-size:26pt">Now</span><span style="font-size:26pt; letter-spacing:-0.65pt"> </span><span style="font-size:26pt">Database</span><span style="font-size:26pt; letter-spacing:-0.6pt"> </span><span style="font-size:26pt">Management</span><span style="font-size:26pt; letter-spacing:-0.85pt"> </span><span style="font-size:26pt">talks</span><span style="font-size:26pt; letter-spacing:-0.5pt"> </span><span style="font-size:26pt; letter-spacing:-0.1pt">about</span>
			</p>
			<p style="margin-top:0pt; margin-left:80.15pt; margin-bottom:0pt; text-indent:-17.95pt; line-height:23.35pt">
				<span style="font-family:Arial; font-size:22pt">•</span><span style="width:10.25pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><span style="font-size:22pt; letter-spacing:-0.1pt">Create</span><span style="font-size:22pt; letter-spacing:-0.8pt"> </span><span style="font-size:22pt; letter-spacing:-0.1pt">Database</span>
			</p>
