			</p>
			<p style="margin-top:0pt; margin-left:80.15pt; margin-bottom:0pt; text-indent:-17.95pt; line-height:23.55pt">
				<span style="font-family:Arial; font-size:22pt">•</span><span style="width:10.25pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><span style="font-size:22pt">Update</span><span style="font-size:22pt; letter-spacing:-1.2pt"> </span><span style="font-size:22pt; letter-spacing:-0.1pt">database</span>
			</p>
			<p style="margin-top:0pt; margin-left:80.15pt; margin-bottom:0pt; text-indent:-17.95pt; line-height:25.2pt">
				<span style="font-family:Arial; font-size:22pt">•</span><span style="width:10.25pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><span style="font-size:22pt">Delete</span><span style="font-size:22pt; letter-spacing:-0.85pt"> </span><span style="font-size:22pt; letter-spacing:-0.1pt">Database</span>
