				<span style="font-family:Arial">•</span><span style="width:9.65pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><strong>Data</strong><strong><span style="letter-spacing:-0.35pt"> </span></strong><strong>Definition:</strong><strong><span style="letter-spacing:-0.55pt"> </span></strong>It<span style="letter-spacing:-0.5pt"> </span>helps<span style="letter-spacing:-0.5pt"> </span>in<span style="letter-spacing:-0.5pt"> </span>creation,<span style="letter-spacing:-0.65pt"> </span>modification<span style="letter-spacing:-0.7pt"> </span>and<span style="letter-spacing:-0.5pt"> </span>removal<span style="letter-spacing:-0.35pt"> </span>of<span style="letter-spacing:-0.55pt"> </span>definitions<span style="letter-spacing:-0.5pt"> </span>that define the organization of data in database.
			</p>
