			</p>
			<p style="margin:9.9pt 35.35pt 0pt 44.2pt; text-indent:-18.05pt; line-height:69%; font-size:24pt">
				<span style="font-family:Arial">•</span><span style="width:9.65pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><strong>Data</strong><strong><span style="letter-spacing:-0.3pt"> </span></strong><strong>Retrieval:</strong><strong><span style="letter-spacing:-0.6pt"> </span></strong>It<span style="letter-spacing:-0.45pt"> </span>helps<span style="letter-spacing:-0.45pt"> </span>in<span style="letter-spacing:-0.45pt"> </span>retrieval<span style="letter-spacing:-0.4pt"> </span>of<span style="letter-spacing:-0.45pt"> </span>data<span style="letter-spacing:-0.55pt"> </span>from<span style="letter-spacing:-0.6pt"> </span>the<span style="letter-spacing:-0.4pt"> </span>database<span style="letter-spacing:-0.5pt"> </span>which<span style="letter-spacing:-0.55pt"> </span>can<span style="letter-spacing:-0.45pt"> </span>be<span style="letter-spacing:-0.4pt"> </span>used by applications for various purposes.
			</p>
			<p style="margin:9.85pt 23.35pt 0pt 44.2pt; text-indent:-18.05pt; line-height:69%; font-size:24pt">
				<span style="font-family:Arial">•</span><span style="width:9.65pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><strong>User Administration: </strong>It helps in registering and monitoring users, enforcing data security, monitoring performance, maintaining data integrity, dealing with concurrency<span style="letter-spacing:-0.95pt"> </span>control<span style="letter-spacing:-1pt"> </span>and<span style="letter-spacing:-0.9pt"> </span>recovering<span style="letter-spacing:-0.85pt"> </span>information<span style="letter-spacing:-1.05pt"> </span>corrupted<span style="letter-spacing:-0.9pt"> </span>by<span style="letter-spacing:-0.85pt"> </span>unexpected<span style="letter-spacing:-0.95pt"> </span>failure.
