			</p>
			<p style="margin-top:4.25pt; margin-left:68.2pt; margin-bottom:0pt; text-indent:-18pt; font-size:15pt">
				<span style="font-family:Arial">•</span><span style="width:12.75pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><span style="letter-spacing:-0.1pt">Example</span>
