				<span style="font-size:44pt; font-weight:normal; letter-spacing:-0.1pt">A</span><span style="font-size:44pt; font-weight:normal; letter-spacing:-2.4pt"> </span><span style="font-size:44pt; font-weight:normal; letter-spacing:-0.1pt">Sample</span><span style="font-size:44pt; font-weight:normal; letter-spacing:-2.35pt"> </span><span style="font-size:44pt; font-weight:normal; letter-spacing:-0.1pt">Relational</span><span style="font-size:44pt; font-weight:normal; letter-spacing:-2.15pt"> </span><span style="font-size:44pt; font-weight:normal; letter-spacing:-0.1pt">Database</span>
			</h1>
			<p style="margin-top:0.5pt; margin-bottom:0pt; font-size:3.5pt">
