		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<p style="margin-top:0pt; margin-left:26.2pt; margin-bottom:0pt; line-height:48.9pt">
				<span style="font-size:44pt; letter-spacing:-0.35pt">Database</span><span style="font-size:44pt; letter-spacing:-1.75pt"> </span><span style="font-size:44pt; letter-spacing:-0.1pt">Design</span>
			</p>
			<p style="margin-top:12.05pt; margin-left:45.1pt; margin-bottom:0pt; font-size:24pt">
				The<span style="letter-spacing:-0.3pt"> </span>process<span style="letter-spacing:-0.35pt"> </span>of<span style="letter-spacing:-0.25pt"> </span>designing<span style="letter-spacing:-0.3pt"> </span>the<span style="letter-spacing:-0.4pt"> </span>general<span style="letter-spacing:-0.2pt"> </span>structure<span style="letter-spacing:-0.45pt"> </span>of<span style="letter-spacing:-0.25pt"> </span>the<span style="letter-spacing:-0.15pt"> </span><span style="letter-spacing:-0.1pt">database:</span>
			</p>
			<p style="margin-top:23.85pt; margin-left:60.65pt; margin-bottom:0pt; text-indent:-17.95pt; font-size:24pt">
				<span style="font-family:Arial">•</span><span style="width:9.55pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>Logical<span style="letter-spacing:-0.35pt"> </span>Design<span style="letter-spacing:-0.15pt"> </span>–<span style="letter-spacing:2.35pt"> </span>Deciding<span style="letter-spacing:-0.45pt"> </span>on<span style="letter-spacing:-0.2pt"> </span>the<span style="letter-spacing:-0.25pt"> </span>database<span style="letter-spacing:-0.15pt"> </span>schema.<span style="letter-spacing:-0.45pt"> </span>Database<span style="letter-spacing:-0.25pt"> </span><span style="letter-spacing:-0.1pt">design</span>
			</p>
			<p style="margin-top:2.35pt; margin-left:60.7pt; margin-bottom:0pt; font-size:24pt">
				requires<span style="letter-spacing:-0.6pt"> </span>that<span style="letter-spacing:-0.5pt"> </span>we<span style="letter-spacing:-0.45pt"> </span>find<span style="letter-spacing:-0.55pt"> </span>a<span style="letter-spacing:-0.55pt"> </span>“good”<span style="letter-spacing:-0.7pt"> </span>collection<span style="letter-spacing:-0.75pt"> </span>of<span style="letter-spacing:-0.55pt"> </span>relation<span style="letter-spacing:-0.5pt"> </span><span style="letter-spacing:-0.1pt">schemas.</span>
			</p>
			<p style="margin-top:2.25pt; margin-left:96.65pt; margin-bottom:0pt; text-indent:-17.95pt; font-size:20pt">
				<span style="font-family:Arial">•</span><span style="width:10.95pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>Business<span style="letter-spacing:-0.4pt"> </span>decision<span style="letter-spacing:-0.2pt"> </span>–<span style="letter-spacing:-0.3pt"> </span>What<span style="letter-spacing:-0.5pt"> </span>attributes<span style="letter-spacing:-0.1pt"> </span>should<span style="letter-spacing:-0.3pt"> </span>we<span style="letter-spacing:-0.4pt"> </span>record<span style="letter-spacing:-0.5pt"> </span>in<span style="letter-spacing:-0.3pt"> </span>the<span style="letter-spacing:-0.4pt"> </span><span style="letter-spacing:-0.1pt">database?</span>
			</p>
			<p style="margin:2pt 164.2pt 0pt 96.7pt; text-indent:-18pt; line-height:108%; font-size:20pt">
				<span style="font-family:Arial">•</span><span style="width:11pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>Computer<span style="letter-spacing:-0.35pt"> </span>Science<span style="letter-spacing:-0.2pt"> </span>decision<span style="letter-spacing:-0.15pt"> </span>–<span style="letter-spacing:4pt"> </span>What<span style="letter-spacing:-0.2pt"> </span>relation<span style="letter-spacing:-0.05pt"> </span>schemas<span style="letter-spacing:-0.1pt"> </span>should<span style="letter-spacing:-0.3pt"> </span>we<span style="letter-spacing:-0.3pt"> </span>have<span style="letter-spacing:-0.2pt"> </span>and how should the attributes be distributed among the various relation <span style="letter-spacing:-0.1pt">schemas?</span>
			</p>
			<p style="margin-top:0.25pt; margin-left:60.65pt; margin-bottom:0pt; text-indent:-17.95pt; font-size:24pt">
				<span style="font-family:Arial">•</span><span style="width:9.55pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>Physical<span style="letter-spacing:-0.6pt"> </span>Design<span style="letter-spacing:-0.4pt"> </span>–<span style="letter-spacing:-0.35pt"> </span>Deciding<span style="letter-spacing:-0.55pt"> </span>on<span style="letter-spacing:-0.4pt"> </span>the<span style="letter-spacing:-0.35pt"> </span>physical<span style="letter-spacing:-0.5pt"> </span>layout<span style="letter-spacing:-0.55pt"> </span>of<span style="letter-spacing:-0.4pt"> </span>the<span style="letter-spacing:-0.3pt"> </span><span style="letter-spacing:-0.1pt">database</span>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h1 style="margin-top:0pt; margin-left:26.2pt; margin-bottom:0pt; line-height:48.9pt">
				<span style="font-size:44pt; font-weight:normal; letter-spacing:-0.7pt">Types</span><span style="font-size:44pt; font-weight:normal; letter-spacing:-1.6pt"> </span><span style="font-size:44pt; font-weight:normal; letter-spacing:-0.7pt">of</span><span style="font-size:44pt; font-weight:normal; letter-spacing:-1.35pt"> </span><span style="font-size:44pt; font-weight:normal; letter-spacing:-0.7pt">DBMS</span><span style="font-size:44pt; font-weight:normal; letter-spacing:-1.75pt"> </span><span style="font-size:44pt; font-weight:normal; letter-spacing:-0.7pt">Architecture</span>
			</h1>
			<p style="margin-top:38.6pt; margin-left:44.2pt; margin-bottom:0pt; text-indent:-18pt; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:8.2pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>One<span style="letter-spacing:-0.95pt"> </span>Tier<span style="letter-spacing:-1.05pt"> </span>Architecture<span style="letter-spacing:-0.75pt"> </span>(Single<span style="letter-spacing:-0.95pt"> </span>Tier<span style="letter-spacing:-1.05pt"> </span><span style="letter-spacing:-0.1pt">Architecture)</span>
			</p>
			<p style="margin-top:6.15pt; margin-left:44.15pt; margin-bottom:0pt; text-indent:-17.95pt; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:8.15pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>Two<span style="letter-spacing:-1.3pt"> </span>Tier<span style="letter-spacing:-1.2pt"> </span><span style="letter-spacing:-0.1pt">Architecture</span>
			</p>
			<p style="margin-top:6.05pt; margin-left:44.2pt; margin-bottom:0pt; text-indent:-18pt; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:8.2pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>Three<span style="letter-spacing:-0.8pt"> </span>Tier<span style="letter-spacing:-0.85pt"> </span><span style="letter-spacing:-0.1pt">Architecture</span>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h1 style="margin-top:0pt; margin-left:61.45pt; margin-bottom:0pt; text-indent:-35.25pt; line-height:48.9pt">
				<span style="font-size:43pt; font-weight:normal; letter-spacing:-0.35pt">1-</span><span style="width:7.57pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0; </span><span style="font-size:44pt; font-weight:normal; letter-spacing:-0.2pt">Tier</span><span style="font-size:44pt; font-weight:normal; letter-spacing:-2.05pt"> </span><span style="font-size:44pt; font-weight:normal; letter-spacing:-0.1pt">Architecture</span>
			</h1>
			<p style="margin:17.8pt 488.7pt 0pt 23.2pt; text-indent:-18pt; line-height:79%; font-size:28pt">
				<span style="height:0pt; margin-top:-17.8pt; display:block; position:absolute; z-index:2"><img src="data:image/png;base64," width="357" height="270" alt="" style="margin-top:58.2pt; margin-left:534.02pt; position:absolute" ></span><span style="font-family:Arial">•</span><span style="width:8.2pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><strong>1</strong><strong><span style="letter-spacing:-0.2pt"> </span></strong><strong>Tier</strong><strong><span style="letter-spacing:-0.05pt"> </span></strong><strong>Architecture </strong>in<span style="letter-spacing:-0.25pt"> </span>DBMS<span style="letter-spacing:-0.05pt"> </span>is the simplest architecture of Database in which the client, server,<span style="letter-spacing:-1.35pt"> </span>and<span style="letter-spacing:-1.4pt"> </span>Database<span style="letter-spacing:-1.3pt"> </span>all<span style="letter-spacing:-1.5pt"> </span>reside on the same machine.
			</p>
			<p style="margin:9.4pt 476.9pt 0pt 23.2pt; text-indent:-18pt; line-height:79%; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:8.2pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>A simple one tier architecture example<span style="letter-spacing:-0.45pt"> </span>would<span style="letter-spacing:-0.45pt"> </span>be<span style="letter-spacing:-0.45pt"> </span>anytime<span style="letter-spacing:-0.45pt"> </span>you install a Database in your system<span style="letter-spacing:-0.8pt"> </span>and<span style="letter-spacing:-0.7pt"> </span>access<span style="letter-spacing:-0.9pt"> </span>it<span style="letter-spacing:-0.8pt"> </span>to<span style="letter-spacing:-0.9pt"> </span>practice SQL queries. But such architecture is rarely used in <span style="letter-spacing:-0.1pt">production.</span>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h1 style="margin-top:0pt; margin-left:61.45pt; margin-bottom:0pt; text-indent:-35.25pt; line-height:48.9pt">
				<span style="font-size:43pt; font-weight:normal; letter-spacing:-0.35pt">2-</span><span style="width:7.57pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0; </span><span style="font-size:44pt; font-weight:normal; letter-spacing:-0.2pt">Tier</span><span style="font-size:44pt; font-weight:normal; letter-spacing:-2.05pt"> </span><span style="font-size:44pt; font-weight:normal; letter-spacing:-0.1pt">Architecture</span>
			</h1>
			<p style="margin:23.8pt 389.05pt 0pt 26.2pt; text-indent:-18pt; line-height:79%; font-size:28pt">
				<span style="height:0pt; margin-top:-23.8pt; display:block; position:absolute; z-index:3"><img src="data:image/png;base64," width="403" height="414" alt="" style="margin-top:17.81pt; margin-left:481.91pt; position:absolute" ></span><span style="font-family:Arial">•</span><span style="width:8.2pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>A <strong>2 Tier Architecture </strong>in DBMS is a Database architecture where the presentation<span style="letter-spacing:-0.05pt"> </span>layer<span style="letter-spacing:-0.4pt"> </span>runs on<span style="letter-spacing:-0.25pt"> </span>a<span style="letter-spacing:-0.3pt"> </span>client<span style="letter-spacing:-0.3pt"> </span>(PC, Mobile,<span style="letter-spacing:-1pt"> </span>Tablet,<span style="letter-spacing:-1.1pt"> </span>etc.),<span style="letter-spacing:-1.1pt"> </span>and<span style="letter-spacing:-1pt"> </span>data<span style="letter-spacing:-1.1pt"> </span>is<span style="letter-spacing:-1.15pt"> </span>stored on a server called the second tier.
			</p>
			<p style="margin:9.4pt 368pt 0pt 26.2pt; text-indent:-18pt; line-height:79%; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:8.2pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><span style="width:36pt; text-indent:0pt; display:inline-block">&#xa0;</span>Two tier architecture provides added security<span style="letter-spacing:-0.25pt"> </span>to<span style="letter-spacing:-0.45pt"> </span>the<span style="letter-spacing:-0.3pt"> </span>DBMS<span style="letter-spacing:-0.2pt"> </span>as<span style="letter-spacing:-0.45pt"> </span>it<span style="letter-spacing:-0.3pt"> </span>is<span style="letter-spacing:-0.45pt"> </span>not<span style="letter-spacing:-0.25pt"> </span>exposed to the end-user directly. It also provides direct and faster communication.
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h1 style="margin-top:0pt; margin-left:61.45pt; margin-bottom:0pt; text-indent:-35.25pt; line-height:48.9pt">
				<span style="font-size:43pt; font-weight:normal; letter-spacing:-0.35pt">3-</span><span style="width:7.57pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0; </span><span style="font-size:44pt; font-weight:normal; letter-spacing:-0.2pt">Tier</span><span style="font-size:44pt; font-weight:normal; letter-spacing:-2.05pt"> </span><span style="font-size:44pt; font-weight:normal; letter-spacing:-0.1pt">Architecture</span>
			</h1>
			<p style="margin:23.8pt 52.35pt 0pt 26.2pt; text-indent:-18pt; line-height:89%; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:8.2pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>A <strong>3 Tier Architecture </strong>in DBMS is the most popular client server architecture<span style="letter-spacing:-0.5pt"> </span>in<span style="letter-spacing:-0.4pt"> </span>DBMS<span style="letter-spacing:-0.3pt"> </span>in<span style="letter-spacing:-0.5pt"> </span>which<span style="letter-spacing:-0.3pt"> </span>the<span style="letter-spacing:-0.45pt"> </span>development<span style="letter-spacing:-0.3pt"> </span>and<span style="letter-spacing:-0.45pt"> </span>maintenance<span style="letter-spacing:-0.4pt"> </span>of functional processes, logic, data access, data storage, and user interface is done independently as separate modules. Three Tier architecture<span style="letter-spacing:-1.45pt"> </span>contains<span style="letter-spacing:-1.2pt"> </span>a<span style="letter-spacing:-1.5pt"> </span>presentation<span style="letter-spacing:-1.2pt"> </span>layer,<span style="letter-spacing:-1.45pt"> </span>an<span style="letter-spacing:-1.5pt"> </span>application<span style="letter-spacing:-1.35pt"> </span>layer,<span style="letter-spacing:-1.45pt"> </span>and<span style="letter-spacing:-1.35pt"> </span>a database server.
			</p>
			<p style="margin:9.3pt 32.35pt 0pt 26.2pt; text-indent:-18pt; line-height:88%; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:8.2pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>3-Tier<span style="letter-spacing:-0.5pt"> </span>database<span style="letter-spacing:-0.4pt"> </span>Architecture<span style="letter-spacing:-0.45pt"> </span>design<span style="letter-spacing:-0.35pt"> </span>is<span style="letter-spacing:-0.6pt"> </span>an<span style="letter-spacing:-0.5pt"> </span>extension<span style="letter-spacing:-0.5pt"> </span>of<span style="letter-spacing:-0.6pt"> </span>the<span style="letter-spacing:-0.45pt"> </span>2-tier<span style="letter-spacing:-0.45pt"> </span>client- server architecture. A 3-tier architecture has the following layers:
			</p>
			<p style="margin-top:2.6pt; margin-left:62.15pt; margin-bottom:0pt; text-indent:-17.95pt; font-size:24pt">
				<span style="font-family:Arial">•</span><span style="width:9.55pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>Presentation<span style="letter-spacing:-1pt"> </span>layer<span style="letter-spacing:-1.1pt"> </span>(your<span style="letter-spacing:-0.95pt"> </span>PC,<span style="letter-spacing:-1pt"> </span>Tablet,<span style="letter-spacing:-0.8pt"> </span>Mobile,<span style="letter-spacing:-0.85pt"> </span><span style="letter-spacing:-0.1pt">etc.)</span>
			</p>
			<p style="margin-top:1.7pt; margin-left:62.15pt; margin-bottom:0pt; text-indent:-17.95pt; font-size:24pt">
				<span style="font-family:Arial">•</span><span style="width:9.55pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>Application<span style="letter-spacing:-0.9pt"> </span>layer<span style="letter-spacing:-0.75pt"> </span><span style="letter-spacing:-0.1pt">(server)</span>
			</p>
			<p style="margin-top:1.65pt; margin-left:62.15pt; margin-bottom:0pt; text-indent:-17.95pt; font-size:24pt">
				<span style="font-family:Arial">•</span><span style="width:9.55pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>Database<span style="letter-spacing:-0.6pt"> </span><span style="letter-spacing:-0.1pt">Server</span>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<p style="margin-top:0pt; margin-bottom:0pt; font-size:26pt">
				&#xa0;
			</p>
			<p style="margin-top:19.35pt; margin-bottom:0pt; font-size:26pt">
				&#xa0;
			</p>
			<p style="margin-top:0pt; margin-left:44.15pt; margin-bottom:0pt; text-indent:-17.95pt; line-height:29.9pt">
				<span style="font-family:Arial; font-size:26pt">•</span><span style="width:8.85pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><span style="font-size:26pt">The</span><span style="font-size:26pt; letter-spacing:-0.6pt"> </span><span style="font-size:26pt">Application</span><span style="font-size:26pt; letter-spacing:-0.5pt"> </span><span style="font-size:26pt">layer</span><span style="font-size:26pt; letter-spacing:-0.25pt"> </span><span style="font-size:26pt">resides</span><span style="font-size:26pt; letter-spacing:-0.6pt"> </span><span style="font-size:26pt">between</span><span style="font-size:26pt; letter-spacing:-0.65pt"> </span><span style="font-size:26pt">the</span><span style="font-size:26pt; letter-spacing:-0.35pt"> </span><span style="font-size:26pt">user</span><span style="font-size:26pt; letter-spacing:-0.5pt"> </span><span style="font-size:26pt">and</span><span style="font-size:26pt; letter-spacing:-0.4pt"> </span><span style="font-size:26pt">the</span><span style="font-size:26pt; letter-spacing:-0.35pt"> </span><span style="font-size:26pt">DBMS,</span><span style="font-size:26pt; letter-spacing:-0.5pt"> </span><span style="font-size:26pt">which</span><span style="font-size:26pt; letter-spacing:-0.35pt"> </span><span style="font-size:26pt; letter-spacing:-0.25pt">is</span>
			</p>
			<p style="margin:0.9pt 4.8pt 0pt 44.2pt; line-height:89%; font-size:26pt">
				responsible<span style="letter-spacing:-0.8pt"> </span>for<span style="letter-spacing:-0.45pt"> </span>communicating<span style="letter-spacing:-0.55pt"> </span>the<span style="letter-spacing:-0.55pt"> </span>user’s<span style="letter-spacing:-0.8pt"> </span>request<span style="letter-spacing:-0.8pt"> </span>to<span style="letter-spacing:-0.5pt"> </span>the<span style="letter-spacing:-0.6pt"> </span>DBMS<span style="letter-spacing:-0.7pt"> </span>system<span style="letter-spacing:-0.85pt"> </span>and send the response from the DBMS to the user. The application layer(business<span style="letter-spacing:-0.05pt"> </span>logic layer) also processes<span style="letter-spacing:-0.05pt"> </span>functional logic, constraint, and rules before passing data to the user or down to the DBMS.
			</p>
			<p style="margin-top:6.6pt; margin-left:26.2pt; margin-bottom:0pt; font-size:26pt">
				<strong>The</strong><strong><span style="letter-spacing:-0.4pt"> </span></strong><strong>goal</strong><strong><span style="letter-spacing:-0.45pt"> </span></strong><strong>of</strong><strong><span style="letter-spacing:-0.45pt"> </span></strong><strong>Three</strong><strong><span style="letter-spacing:-0.45pt"> </span></strong><strong>Tier</strong><strong><span style="letter-spacing:-0.35pt"> </span></strong><strong>client-server</strong><strong><span style="letter-spacing:-0.4pt"> </span></strong><strong>architecture</strong><strong><span style="letter-spacing:-0.25pt"> is:</span></strong>
			</p>
			<p style="margin-top:6.45pt; margin-left:44.15pt; margin-bottom:0pt; text-indent:-17.95pt; font-size:26pt">
				<span style="font-family:Arial">•</span><span style="width:8.85pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>To<span style="letter-spacing:-0.95pt"> </span>separate<span style="letter-spacing:-1.05pt"> </span>the<span style="letter-spacing:-0.8pt"> </span>user<span style="letter-spacing:-0.9pt"> </span>applications<span style="letter-spacing:-0.85pt"> </span>and<span style="letter-spacing:-0.85pt"> </span>physical<span style="letter-spacing:-0.8pt"> </span><span style="letter-spacing:-0.1pt">database</span>
			</p>
			<p style="margin-top:6.3pt; margin-left:44.15pt; margin-bottom:0pt; text-indent:-17.95pt; font-size:26pt">
				<span style="font-family:Arial">•</span><span style="width:8.85pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>To<span style="letter-spacing:-1.1pt"> </span>support<span style="letter-spacing:-0.85pt"> </span>DBMS<span style="letter-spacing:-0.95pt"> </span><span style="letter-spacing:-0.1pt">characteristics</span>
			</p>
			<p style="margin-top:6.3pt; margin-left:44.15pt; margin-bottom:0pt; text-indent:-17.95pt; font-size:26pt">
				<span style="font-family:Arial">•</span><span style="width:8.85pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><span style="letter-spacing:-0.1pt">Program-data</span><span style="letter-spacing:-0.5pt"> </span><span style="letter-spacing:-0.1pt">independence</span>
			</p>
			<p style="margin-top:6.45pt; margin-left:44.15pt; margin-bottom:0pt; text-indent:-17.95pt; font-size:26pt">
				<span style="font-family:Arial">•</span><span style="width:8.85pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>Supporting<span style="letter-spacing:-0.25pt"> </span>multiple<span style="letter-spacing:-0.4pt"> </span>views<span style="letter-spacing:-0.25pt"> </span>of<span style="letter-spacing:-0.2pt"> </span>the<span style="letter-spacing:-0.25pt"> </span><span style="letter-spacing:-0.2pt">data</span>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h1 style="margin-top:0pt; margin-left:26.2pt; margin-bottom:0pt; line-height:48.9pt">
				<span style="font-size:44pt; font-weight:normal; letter-spacing:-0.2pt">3-Tier</span><span style="font-size:44pt; font-weight:normal; letter-spacing:-2.2pt"> </span><span style="font-size:44pt; font-weight:normal; letter-spacing:-0.2pt">Architecture</span>
			</h1>
			<p style="margin-top:0pt; margin-bottom:0pt; font-size:10pt">
				&#xa0;
			</p>
			<p style="margin-top:11.9pt; margin-bottom:0pt; font-size:10pt">
				<img src="data:image/png;base64," width="813" height="353" alt="" ><br >
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<p style="margin-top:0pt; margin-left:26.2pt; margin-bottom:0pt; line-height:48.9pt">
				<span style="font-size:44pt">Database</span><span style="font-size:44pt; letter-spacing:-2.4pt"> </span><span style="font-size:44pt">Users</span><span style="font-size:44pt; letter-spacing:-2.4pt"> </span><span style="font-size:44pt">&amp;</span><span style="font-size:44pt; letter-spacing:-2.4pt"> </span><span style="font-size:44pt; letter-spacing:-0.25pt">DBA</span>
			</p>
			<p style="margin:41.85pt 29.5pt 0pt 44.2pt; text-indent:-18.05pt; line-height:69%; font-size:26pt">
				<span style="font-family:Arial">•</span><span style="width:8.85pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><strong>Database Administrator (DBA) : </strong>Database Administrator (DBA) is a person/team who defines the schema and also controls the 3 levels of database.<span style="letter-spacing:-0.25pt"> </span>The<span style="letter-spacing:-0.45pt"> </span>DBA<span style="letter-spacing:-0.4pt"> </span>will<span style="letter-spacing:-0.2pt"> </span>then<span style="letter-spacing:-0.4pt"> </span>create<span style="letter-spacing:-0.45pt"> </span>a<span style="letter-spacing:-0.2pt"> </span>new<span style="letter-spacing:-0.35pt"> </span>account<span style="letter-spacing:-0.3pt"> </span>id<span style="letter-spacing:-0.25pt"> </span>and<span style="letter-spacing:-0.3pt"> </span>password<span style="letter-spacing:-0.35pt"> </span>for<span style="letter-spacing:-0.15pt"> </span>the user if he/she<span style="letter-spacing:-0.05pt"> </span>need to access the database. DBA is also responsible for providing<span style="letter-spacing:-0.4pt"> </span>security<span style="letter-spacing:-0.6pt"> </span>to<span style="letter-spacing:-0.3pt"> </span>the<span style="letter-spacing:-0.4pt"> </span>database<span style="letter-spacing:-0.45pt"> </span>and<span style="letter-spacing:-0.4pt"> </span>he<span style="letter-spacing:-0.4pt"> </span>allows<span style="letter-spacing:-0.2pt"> </span>only<span style="letter-spacing:-0.25pt"> </span>the<span style="letter-spacing:-0.5pt"> </span>authorized<span style="letter-spacing:-0.5pt"> </span>users to access/modify the data base.
			</p>
			<p style="margin:9.6pt 60.95pt 0pt 44.2pt; text-indent:-18.05pt; line-height:69%; font-size:26pt">
				<span style="font-family:Arial">•</span><span style="width:8.85pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>DBA<span style="letter-spacing:-0.4pt"> </span>is<span style="letter-spacing:-0.3pt"> </span>responsible<span style="letter-spacing:-0.55pt"> </span>for<span style="letter-spacing:-0.15pt"> </span>the<span style="letter-spacing:-0.4pt"> </span>problems<span style="letter-spacing:-0.55pt"> </span>such<span style="letter-spacing:-0.4pt"> </span>as<span style="letter-spacing:-0.2pt"> </span>security<span style="letter-spacing:-0.55pt"> </span>breaches<span style="letter-spacing:-0.55pt"> </span>and<span style="letter-spacing:-0.25pt"> </span>poor system response time.
			</p>
			<p style="margin-top:0pt; margin-left:80.15pt; margin-bottom:0pt; text-indent:-17.95pt; line-height:23.65pt">
				<span style="font-family:Arial; font-size:22pt">•</span><span style="width:10.25pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><span style="font-size:22pt">DBA</span><span style="font-size:22pt; letter-spacing:-0.95pt"> </span><span style="font-size:22pt">also</span><span style="font-size:22pt; letter-spacing:-1.1pt"> </span><span style="font-size:22pt">monitors</span><span style="font-size:22pt; letter-spacing:-0.9pt"> </span><span style="font-size:22pt">the</span><span style="font-size:22pt; letter-spacing:-0.85pt"> </span><span style="font-size:22pt">recovery</span><span style="font-size:22pt; letter-spacing:-0.95pt"> </span><span style="font-size:22pt">and</span><span style="font-size:22pt; letter-spacing:-1.1pt"> </span><span style="font-size:22pt">backup</span><span style="font-size:22pt; letter-spacing:-1.1pt"> </span><span style="font-size:22pt">and</span><span style="font-size:22pt; letter-spacing:-1pt"> </span><span style="font-size:22pt">provide</span><span style="font-size:22pt; letter-spacing:-1pt"> </span><span style="font-size:22pt">technical</span><span style="font-size:22pt; letter-spacing:-0.9pt"> </span><span style="font-size:22pt; letter-spacing:-0.1pt">support.</span>
			</p>
			<p style="margin-top:0pt; margin-left:80.15pt; margin-bottom:0pt; text-indent:-17.95pt; line-height:23.45pt">
				<span style="font-family:Arial; font-size:22pt">•</span><span style="width:10.25pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><span style="font-size:22pt">The</span><span style="font-size:22pt; letter-spacing:-0.55pt"> </span><span style="font-size:22pt">DBA</span><span style="font-size:22pt; letter-spacing:-0.7pt"> </span><span style="font-size:22pt">has</span><span style="font-size:22pt; letter-spacing:-0.65pt"> </span><span style="font-size:22pt">a</span><span style="font-size:22pt; letter-spacing:-0.7pt"> </span><span style="font-size:22pt">DBA</span><span style="font-size:22pt; letter-spacing:-0.55pt"> </span><span style="font-size:22pt">account</span><span style="font-size:22pt; letter-spacing:-0.7pt"> </span><span style="font-size:22pt">in</span><span style="font-size:22pt; letter-spacing:-0.65pt"> </span><span style="font-size:22pt">the</span><span style="font-size:22pt; letter-spacing:-0.5pt"> </span><span style="font-size:22pt">DBMS</span><span style="font-size:22pt; letter-spacing:-0.7pt"> </span><span style="font-size:22pt">which</span><span style="font-size:22pt; letter-spacing:-0.75pt"> </span><span style="font-size:22pt">called</span><span style="font-size:22pt; letter-spacing:-0.6pt"> </span><span style="font-size:22pt">a</span><span style="font-size:22pt; letter-spacing:-0.7pt"> </span><span style="font-size:22pt">system</span><span style="font-size:22pt; letter-spacing:-0.4pt"> </span><span style="font-size:22pt">or</span><span style="font-size:22pt; letter-spacing:-0.35pt"> </span><span style="font-size:22pt">superuser</span><span style="font-size:22pt; letter-spacing:-0.7pt"> </span><span style="font-size:22pt; letter-spacing:-0.1pt">account.</span>
			</p>
			<p style="margin-top:0pt; margin-left:80.15pt; margin-bottom:0pt; text-indent:-17.95pt; line-height:23.5pt">
				<span style="font-family:Arial; font-size:22pt">•</span><span style="width:10.25pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><span style="font-size:22pt">DBA</span><span style="font-size:22pt; letter-spacing:-0.95pt"> </span><span style="font-size:22pt">repairs</span><span style="font-size:22pt; letter-spacing:-1.1pt"> </span><span style="font-size:22pt">damage</span><span style="font-size:22pt; letter-spacing:-0.85pt"> </span><span style="font-size:22pt">caused</span><span style="font-size:22pt; letter-spacing:-0.95pt"> </span><span style="font-size:22pt">due</span><span style="font-size:22pt; letter-spacing:-0.9pt"> </span><span style="font-size:22pt">to</span><span style="font-size:22pt; letter-spacing:-0.95pt"> </span><span style="font-size:22pt">hardware</span><span style="font-size:22pt; letter-spacing:-1.1pt"> </span><span style="font-size:22pt">and/or</span><span style="font-size:22pt; letter-spacing:-1.1pt"> </span><span style="font-size:22pt">software</span><span style="font-size:22pt; letter-spacing:-0.95pt"> </span><span style="font-size:22pt; letter-spacing:-0.1pt">failures.</span>
			</p>
			<p style="margin:4.85pt 30.25pt 0pt 80.2pt; text-indent:-18pt; line-height:69%; font-size:22pt">
				<span style="font-family:Arial">•</span><span style="width:10.3pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>DBA<span style="letter-spacing:-0.45pt"> </span>is<span style="letter-spacing:-0.55pt"> </span>the<span style="letter-spacing:-0.55pt"> </span>one<span style="letter-spacing:-0.4pt"> </span>having<span style="letter-spacing:-0.7pt"> </span>privileges<span style="letter-spacing:-0.55pt"> </span>to<span style="letter-spacing:-0.45pt"> </span>perform<span style="letter-spacing:-0.4pt"> </span>DCL<span style="letter-spacing:-0.55pt"> </span>(Data<span style="letter-spacing:-0.55pt"> </span>Control<span style="letter-spacing:-0.5pt"> </span>Language)<span style="letter-spacing:-0.45pt"> </span>operations such as GRANT and REVOKE, to allow/restrict a particular user from accessing the <span style="letter-spacing:-0.1pt">database.</span>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<p style="margin-top:0pt; margin-bottom:0pt; font-size:28pt">
				&#xa0;
			</p>
			<p style="margin-top:17.05pt; margin-bottom:0pt; font-size:28pt">
				&#xa0;
			</p>
			<p style="margin:0.05pt 23.4pt 0pt 44.2pt; text-indent:-18.05pt; line-height:89%; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:8.25pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><strong>Application</strong><strong><span style="letter-spacing:-0.5pt"> </span></strong><strong>Programmers</strong><strong><span style="letter-spacing:-0.45pt"> </span></strong><strong>:</strong><strong><span style="letter-spacing:-0.4pt"> </span></strong>Application<span style="letter-spacing:-0.4pt"> </span>Programmers<span style="letter-spacing:-0.45pt"> </span>also<span style="letter-spacing:-0.7pt"> </span>referred<span style="letter-spacing:-0.6pt"> </span>as System Analysts or simply Software Engineers, are the back-end programmers<span style="letter-spacing:-0.6pt"> </span>who<span style="letter-spacing:-0.7pt"> </span>writes<span style="letter-spacing:-0.8pt"> </span>the<span style="letter-spacing:-0.7pt"> </span>code<span style="letter-spacing:-0.75pt"> </span>for<span style="letter-spacing:-0.7pt"> </span>the<span style="letter-spacing:-0.75pt"> </span>application<span style="letter-spacing:-0.65pt"> </span>programs.<span style="letter-spacing:-0.5pt"> </span>They are the computer professionals.
			</p>
			<p style="margin:9.65pt 42.25pt 0pt 44.2pt; text-indent:-18.05pt; line-height:88%; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:8.25pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>These<span style="letter-spacing:-0.75pt"> </span>programs<span style="letter-spacing:-0.45pt"> </span>could<span style="letter-spacing:-0.5pt"> </span>be<span style="letter-spacing:-0.65pt"> </span>written<span style="letter-spacing:-0.75pt"> </span>in<span style="letter-spacing:-0.7pt"> </span>Programming<span style="letter-spacing:-0.45pt"> </span>languages<span style="letter-spacing:-0.65pt"> </span>such<span style="letter-spacing:-0.5pt"> </span>as Visual Basic, Developer, C, FORTRAN, COBOL etc.
			</p>
			<p style="margin:10.3pt 70.15pt 0pt 44.2pt; text-indent:-18.05pt; text-align:justify; line-height:88%; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:8.25pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>Application<span style="letter-spacing:-0.55pt"> </span>programmers<span style="letter-spacing:-0.6pt"> </span>design,<span style="letter-spacing:-0.6pt"> </span>debug,<span style="letter-spacing:-0.6pt"> </span>test,<span style="letter-spacing:-0.7pt"> </span>and<span style="letter-spacing:-0.7pt"> </span>maintain<span style="letter-spacing:-0.65pt"> </span>set<span style="letter-spacing:-0.8pt"> </span>of programs<span style="letter-spacing:-0.4pt"> </span>called<span style="letter-spacing:-0.65pt"> </span>“canned<span style="letter-spacing:-0.5pt"> </span>transactions”<span style="letter-spacing:-0.25pt"> </span>for<span style="letter-spacing:-0.65pt"> </span>the<span style="letter-spacing:-0.5pt"> </span>Naive<span style="letter-spacing:-0.5pt"> </span>(parametric) users in order to interact with database.
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<p style="margin-top:40.15pt; margin-bottom:0pt; font-size:37pt">
				&#xa0;
			</p>
			<p style="margin:0pt 19pt 0pt 44.2pt; text-indent:-18.05pt; line-height:69%; font-size:37pt">
				<span style="font-family:Arial">•</span><span style="width:5.1pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0; </span><strong>Naive</strong><strong><span style="letter-spacing:-1pt"> </span></strong><strong>/</strong><strong><span style="letter-spacing:-0.95pt"> </span></strong><strong>Parametric</strong><strong><span style="letter-spacing:-0.75pt"> </span></strong><strong>End</strong><strong><span style="letter-spacing:-0.95pt"> </span></strong><strong>Users</strong><strong><span style="letter-spacing:-0.9pt"> </span></strong><strong>:</strong><strong><span style="letter-spacing:-0.65pt"> </span></strong>Parametric<span style="letter-spacing:-1pt"> </span>End<span style="letter-spacing:-0.7pt"> </span>Users are the unsophisticated who don’t have any DBMS knowledge but they frequently use the database applications in their daily life to get the desired <span style="letter-spacing:-0.1pt">results.</span>
			</p>
			<p style="margin-top:0pt; margin-left:44.15pt; margin-bottom:0pt; text-indent:-17.95pt; line-height:36.9pt">
				<span style="font-family:Arial; font-size:37pt">•</span><span style="width:5pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0; </span><span style="font-size:37pt">For</span><span style="font-size:37pt; letter-spacing:-2.1pt"> </span><span style="font-size:37pt">examples,</span><span style="font-size:37pt; letter-spacing:-2.1pt"> </span><span style="font-size:37pt">Railway’s</span><span style="font-size:37pt; letter-spacing:-2.05pt"> </span><span style="font-size:37pt">ticket</span><span style="font-size:37pt; letter-spacing:-2.05pt"> </span><span style="font-size:37pt">booking</span><span style="font-size:37pt; letter-spacing:-2.05pt"> </span><span style="font-size:37pt">users</span><span style="font-size:37pt; letter-spacing:-2.05pt"> </span><span style="font-size:37pt; letter-spacing:-0.25pt">are</span>
			</p>
			<p style="margin-top:0pt; margin-left:44.2pt; margin-bottom:0pt; text-align:justify; line-height:31.1pt">
				<span style="font-size:37pt">naive</span><span style="font-size:37pt; letter-spacing:-0.85pt"> </span><span style="font-size:37pt">users.</span><span style="font-size:37pt; letter-spacing:-0.7pt"> </span><span style="font-size:37pt">Clerks</span><span style="font-size:37pt; letter-spacing:-0.75pt"> </span><span style="font-size:37pt">in</span><span style="font-size:37pt; letter-spacing:-0.95pt"> </span><span style="font-size:37pt">any</span><span style="font-size:37pt; letter-spacing:-0.9pt"> </span><span style="font-size:37pt">bank</span><span style="font-size:37pt; letter-spacing:-0.6pt"> </span><span style="font-size:37pt">is</span><span style="font-size:37pt; letter-spacing:-0.9pt"> </span><span style="font-size:37pt">a</span><span style="font-size:37pt; letter-spacing:-0.85pt"> </span><span style="font-size:37pt">naive</span><span style="font-size:37pt; letter-spacing:-0.85pt"> </span><span style="font-size:37pt; letter-spacing:-0.2pt">user</span>
			</p>
			<p style="margin:3.9pt 52.4pt 0pt 44.2pt; text-align:justify; line-height:69%; font-size:37pt">
				because<span style="letter-spacing:-0.5pt"> </span>they<span style="letter-spacing:-0.6pt"> </span>don’t<span style="letter-spacing:-0.6pt"> </span>have<span style="letter-spacing:-0.65pt"> </span>any<span style="letter-spacing:-0.7pt"> </span>DBMS<span style="letter-spacing:-0.75pt"> </span>knowledge<span style="letter-spacing:-0.45pt"> </span>but they<span style="letter-spacing:-0.1pt"> </span>still<span style="letter-spacing:-0.1pt"> </span>use<span style="letter-spacing:-0.1pt"> </span>the database and<span style="letter-spacing:-0.1pt"> </span>perform<span style="letter-spacing:-0.15pt"> </span>their<span style="letter-spacing:-0.05pt"> </span>given <span style="letter-spacing:-0.1pt">task.</span>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<p style="margin-top:0pt; margin-bottom:0pt; font-size:24pt">
				&#xa0;
			</p>
			<p style="margin-top:24.45pt; margin-bottom:0pt; font-size:24pt">
				&#xa0;
			</p>
			<p style="margin-top:0.05pt; margin-left:26.2pt; margin-bottom:0pt; line-height:27.6pt">
				<strong><span style="font-size:24pt; ">System</span></strong><strong><span style="font-size:24pt; letter-spacing:-0.85pt"> </span></strong><strong><span style="font-size:24pt; ">Analyst</span></strong><strong><span style="font-size:24pt; letter-spacing:-0.85pt"> </span></strong><strong><span style="font-size:24pt; letter-spacing:-0.5pt">:</span></strong>
			</p>
			<p style="margin-top:1.05pt; margin-left:44.2pt; margin-bottom:0pt; line-height:88%; font-size:24pt">
				System<span style="letter-spacing:-0.75pt"> </span>Analyst<span style="letter-spacing:-0.6pt"> </span>is<span style="letter-spacing:-0.5pt"> </span>a<span style="letter-spacing:-0.6pt"> </span>user<span style="letter-spacing:-0.45pt"> </span>who<span style="letter-spacing:-0.5pt"> </span>analyzes<span style="letter-spacing:-0.5pt"> </span>the<span style="letter-spacing:-0.55pt"> </span>requirements<span style="letter-spacing:-0.5pt"> </span>of<span style="letter-spacing:-0.4pt"> </span>parametric<span style="letter-spacing:-0.75pt"> </span>end<span style="letter-spacing:-0.5pt"> </span>users. They check whether all the requirements of end users are satisfied.
			</p>
			<p style="margin-top:7.65pt; margin-left:26.2pt; margin-bottom:0pt; font-size:24pt">
				<strong>Sophisticated</strong><strong><span style="letter-spacing:-0.75pt"> </span></strong><strong>Users</strong><strong><span style="letter-spacing:-0.8pt"> </span></strong><strong><span style="letter-spacing:-0.5pt">:</span></strong>
			</p>
			<p style="margin:9.3pt 60.95pt 0pt 44.2pt; text-indent:-18.05pt; line-height:88%; font-size:24pt">
				<span style="font-family:Arial">•</span><span style="width:9.65pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>Sophisticated users can be engineers, scientists, business analyst, who are familiar<span style="letter-spacing:-0.55pt"> </span>with<span style="letter-spacing:-0.6pt"> </span>the<span style="letter-spacing:-0.45pt"> </span>database.<span style="letter-spacing:-0.65pt"> </span>They<span style="letter-spacing:-0.45pt"> </span>can<span style="letter-spacing:-0.5pt"> </span>develop<span style="letter-spacing:-0.4pt"> </span>their<span style="letter-spacing:-0.5pt"> </span>own<span style="letter-spacing:-0.5pt"> </span>database<span style="letter-spacing:-0.5pt"> </span>applications according to their requirement.
			</p>
			<p style="margin-top:7.65pt; margin-left:44.2pt; margin-bottom:0pt; text-indent:-18pt; line-height:27.6pt">
				<span style="font-family:Arial; font-size:24pt">•</span><span style="width:9.6pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><span style="font-size:24pt">They</span><span style="font-size:24pt; letter-spacing:-0.3pt"> </span><span style="font-size:24pt">don’t</span><span style="font-size:24pt; letter-spacing:-0.35pt"> </span><span style="font-size:24pt">write</span><span style="font-size:24pt; letter-spacing:-0.35pt"> </span><span style="font-size:24pt">the</span><span style="font-size:24pt; letter-spacing:-0.25pt"> </span><span style="font-size:24pt">program</span><span style="font-size:24pt; letter-spacing:-0.5pt"> </span><span style="font-size:24pt">code</span><span style="font-size:24pt; letter-spacing:-0.25pt"> </span><span style="font-size:24pt">but</span><span style="font-size:24pt; letter-spacing:-0.3pt"> </span><span style="font-size:24pt">they</span><span style="font-size:24pt; letter-spacing:-0.35pt"> </span><span style="font-size:24pt">interact</span><span style="font-size:24pt; letter-spacing:-0.5pt"> </span><span style="font-size:24pt">the</span><span style="font-size:24pt; letter-spacing:-0.25pt"> </span><span style="font-size:24pt">database</span><span style="font-size:24pt; letter-spacing:-0.35pt"> </span><span style="font-size:24pt">by</span><span style="font-size:24pt; letter-spacing:-0.25pt"> </span><span style="font-size:24pt">writing</span><span style="font-size:24pt; letter-spacing:-0.45pt"> </span><span style="font-size:24pt; letter-spacing:-0.25pt">SQL</span>
			</p>
			<p style="margin-top:0pt; margin-left:44.2pt; margin-bottom:0pt; line-height:27.6pt">
				<span style="font-size:24pt">queries</span><span style="font-size:24pt; letter-spacing:-0.3pt"> </span><span style="font-size:24pt">directly</span><span style="font-size:24pt; letter-spacing:-0.4pt"> </span><span style="font-size:24pt">through</span><span style="font-size:24pt; letter-spacing:-0.15pt"> </span><span style="font-size:24pt">the</span><span style="font-size:24pt; letter-spacing:-0.15pt"> </span><span style="font-size:24pt">query</span><span style="font-size:24pt; letter-spacing:-0.2pt"> </span><span style="font-size:24pt; letter-spacing:-0.1pt">processor.</span>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<p style="margin-top:0pt; margin-bottom:0pt; font-size:28pt">
				&#xa0;
			</p>
			<p style="margin-top:17.05pt; margin-bottom:0pt; font-size:28pt">
				&#xa0;
			</p>
			<p style="margin:0.05pt 44.95pt 0pt 44.2pt; text-indent:-18.05pt; line-height:89%; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:8.25pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><strong>Database</strong><strong><span style="letter-spacing:-0.45pt"> </span></strong><strong>Designers</strong><strong><span style="letter-spacing:-0.4pt"> </span></strong><strong>:</strong><strong><span style="letter-spacing:-0.35pt"> </span></strong>Data<span style="letter-spacing:-0.6pt"> </span>Base<span style="letter-spacing:-0.55pt"> </span>Designers<span style="letter-spacing:-0.4pt"> </span>are<span style="letter-spacing:-0.6pt"> </span>the<span style="letter-spacing:-0.55pt"> </span>users<span style="letter-spacing:-0.4pt"> </span>who<span style="letter-spacing:-0.5pt"> </span>design the structure of database which includes tables, indexes, views, triggers, stored procedures and constraints which are usually enforced before the database is created or populated with data.
			</p>
			<p style="margin:9.65pt 30.4pt 0pt 44.2pt; text-indent:-18.05pt; line-height:88%; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:8.25pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>He/she<span style="letter-spacing:-0.45pt"> </span>controls<span style="letter-spacing:-0.5pt"> </span>what<span style="letter-spacing:-0.7pt"> </span>data<span style="letter-spacing:-0.65pt"> </span>must<span style="letter-spacing:-0.3pt"> </span>be<span style="letter-spacing:-0.6pt"> </span>stored<span style="letter-spacing:-0.6pt"> </span>and<span style="letter-spacing:-0.45pt"> </span>how<span style="letter-spacing:-0.65pt"> </span>the<span style="letter-spacing:-0.6pt"> </span>data<span style="letter-spacing:-0.65pt"> </span>items<span style="letter-spacing:-0.6pt"> </span>to be related.
			</p>
			<p style="margin:10.3pt 25.6pt 0pt 44.2pt; text-indent:-18.05pt; line-height:88%; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:8.25pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>It is responsibility of Database Designers to understand the requirements<span style="letter-spacing:-0.45pt"> </span>of<span style="letter-spacing:-0.8pt"> </span>different<span style="letter-spacing:-0.65pt"> </span>user<span style="letter-spacing:-0.6pt"> </span>groups<span style="letter-spacing:-0.55pt"> </span>and<span style="letter-spacing:-0.55pt"> </span>then<span style="letter-spacing:-0.75pt"> </span>create<span style="letter-spacing:-0.75pt"> </span>a<span style="letter-spacing:-0.85pt"> </span>design<span style="letter-spacing:-0.55pt"> </span>which satisfies the need of all the user groups.
			</p>
		</div>
